import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Lecturer from "./components/Lecturer";
import Student from "./components/Student";
import PRL from "./components/PRL";
import PL from "./components/PL";

export default function App() {
  return (
    <Router>
      <div className="container py-4">
        <h1 className="mb-4">LUCT Reporting App</h1>

        {/* Navigation */}
        <nav className="mb-4">
          <Link to="/lecturer" className="btn btn-outline-primary me-2">
            Lecturer
          </Link>
          <Link to="/student" className="btn btn-outline-success me-2">
            Student
          </Link>
          <Link to="/prl" className="btn btn-outline-warning me-2">
            PRL
          </Link>
          <Link to="/pl" className="btn btn-outline-dark">
            PL
          </Link>
        </nav>

        {/* Page Content */}
        <Routes>
          <Route path="/lecturer" element={<Lecturer />} />
          <Route path="/student" element={<Student />} />
          <Route path="/prl" element={<PRL />} />
          <Route path="/pl" element={<PL />} />
          {/* Default route goes to Lecturer */}
          <Route path="*" element={<Lecturer />} />
        </Routes>
      </div>
    </Router>
  );
}
